се\nБрызжет желчью на весь дом\nПритворяется он лохом\n\nГоворит что не женат\nЗалетает на поток\nМикро офает дедок\nПодкаблучник цок-цок-цок\n\n==== 2 секция видео ====\n\nДенис-пенис суха-черт\nКак то съездил в космопорт\nПока пиццу выбирал\nРоцкер Кралине на клык давал\n\nМежпланетным был дедок\nПару дней тому назад\nДве планеты не видать\nУстал он кралину содержать\n\nДепресуха, биполяра\nСнова бьют дедка по швам\nОн мечтает о ее губах\nНо вся майка у него в слезах\n\n==== 3 секция видео ====\n\nПо полляма он за стрим\nСобирает каждый день\nНо куда то все сливает\nДобрых зяблов обижает\n\nПод Самарой городком\nЕсть там маленький дурдом\nДва шизоида там сидит\nОдин пердит, другой визжит\n\nЖадный крол и хитрый лес\nСобирает на свой каприз\n(грущих?) зяблов обжимает\nНа каблук он собирает\n\nНадоил наш деда гроши\nСколотил он ???\nЧе-то как-то не срослось\nПо изде все понеслось\n\nГовногруппа Алинки нашей\nРастеклась по полу кашей\nОтлизала у Сухача\nВ уши затекла моча\n\nТридцать лет тому дебилу,\nКто пердит и ссыт в ведро,\nБабки просит, ему все мало\nГорлышко его устало\n\nЭтот Пенис, тот что Денчик\nДрессированный осел\nГолосок его услышишь\nТак закинь ему пару тысяч\n\nПожилым он так старается\nБыть на стриме каждый день\nС головой он не общается\nОбраз свой забыл надеть\n\nГоворит что он мужик\nИ Альфач он пожилой\nНо как только она стучит\nПод каблук Сухач летит\n\n==== 4 секция видео ====\n\nОтлежал себе он сраку\nНе пройти через порог\nОткормила Алинка тварь\nКиви в рот клади и жарь\n\nЗакрывает дверь в гараж\nКак бы не спалить жену\nНо похавать ему надо\nБлекстар бургер заглотнул\n\nРаскатал его по фактам\nСонька брызнула экстрактом\nУмолял остановиться\nПрям на сцене он бесился\n\nУ Ралинки под пупком\nЕсть татухи по бокам\nСправа там нептун сидит\nЮпитер слева там набит\n\nЗахожу я на поток\nкак всегда весенним утром,\nЦены на донат поднял,\nНа пеленки все собрал\n\nНа видосе про гараж\nВырезал фрагмент с пенисом\nДеанон давно прошел\nОказался он Денис  три часа. Куда еще дольше и куда скажи мне сложные вопросы? Никто бы на них не ответил и это бы длилось вечность. Опираясь на статистику да и на видео опросы, большинство людей не знают название мировых столиц и какому государству они принадлежат. Боюсь представить даже, как бы это позорно и некрасиво выглядело для участников. Люди реальные и видно, что они не подставные. Да, кто то зарегался и забыл, а потом оказалось, что твой выиграл и тебе звонят. Да в такой ситуации попробуйте сориентироваться и понять, что от вас спрашивают и откуда этот звонок.\nНу не выиграли, это же лотерея, лучше бы делом занялись, развивались, а не тратили время на жизнь в сети.\nЯ тоже хотел выиграть грант для сестры. Да, не получилось, значит поедет на платной основе, а что делать если хочет.\nНе понимаю людей, которые агрятся и зляться на проигрыш в конкурсе, и начинают винить так же поливать грязью все и вся! Я понимаю если вы трудились в поте и крови, и вложили многое в этот конкурс. А потом ничего не получили взамен. Отнюдь, вы кликнули мышкой и ждете чуда. Много добьетесь!"},{"author":"Анастасия Когут","date":"2021-02-17 14:53:27","likes":"unknown","text":"История еще одного обиженного человека\nЯ сама там училась и не надо дезинформировать людей, никто на деньги не кидает\nво-первых, обучение оплачивается только после подписания договора\nво-вторых, в договоре все прописано об оплате, возвращении денег итд и на прочтение его дается столько времени, сколько вам понадобится"},{"author":"Meinl Shop - хорошие продукты","date":"2021-02-16 20:54:58","likes":"unknown","text":"Аферисты! Они кидают людей на деньги 💰💰💰 Ни в коем случае не делайте никакие оплаты. Когда передумаете, а вы передумаете, вам ничего не вернут. Им даже не важно, подписан договор или нет. При этом они ведут себя очень нагло. Как будто абсолютно уверены в безнаказанности. чувствуют"}],"draftPlaylist":false,"note":"Итоговая запись и проект в давинчи удалены, остались только ассеты","codeName":"aferisty_v_gostudy_isto
